import React from "react";
import { Modal, Button, Row, Col } from "react-bootstrap";

const ViewExpense = (props) => {
  const data = props.data;
  console.log("daTA ->");
  console.log(data);
  return (
    <Modal onHide={props.onHide} show={props.show} dialogClassName="modal-100w" backdrop="static">
      <Modal.Header closeButton>
        <Modal.Title>Expense Entry</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <div>
          <Row>
            <Col xs={4} type="wide-col">
              <Row>
                {" "}
                <div>
                  {" "}
                  <small>
                    {" "}
                    <i className="bi bi-person" type="employee-icon"></i>{" "}
                    Employee
                  </small>{" "}
                </div>
              </Row>
              <Row>
                <p>
                  {data.employee.firstName + " " + data.employee.lastName}
                </p>
              </Row>
            </Col>
            <Col xs={4} type="wide-col">
              <Row>
                <div>
                  {" "}
                  <small>
                  <i className="bi bi-calendar2-event"></i> Entry Date{" "}
                  </small>{" "}
                </div>
              </Row>
              <Row>
                <p>{data.date}</p>
              </Row>
            </Col>
            <Col xs={4} type="wide-col">
              <Row>
                <div>
                  {" "}
                  <small>
                    <i className="bi bi-cash"></i> Total Reimbursement
                  </small>{" "}
                </div>
              </Row>
              <Row>
                <p>
                  {data.currency + " " + data.amount}
                </p>
              </Row>
            </Col>

            <Col xs={4} type="wide-col">
              <Row>
                <div>
                  {" "}
                  <small>
                    <i className="bi bi-grid"></i> Status{" "}
                  </small>
                </div>
              </Row>
              <Row>
                <p>{data.status}</p>
              </Row>
            </Col>
          </Row>
        </div>
      </Modal.Body>

      <Modal.Footer>
        <Button
          variant="primary"
          //   onClick={handleSubmit}
        >
          Print
        </Button>
        <Button variant="secondary" onClick={props.onHide}>
          Close
        </Button>
      </Modal.Footer>
    </Modal>
  );
};

export default ViewExpense;
